--
-- Name: subscriptions_as_tree(); Type: FUNCTION; Schema: public; Owner: circl
--

CREATE FUNCTION subscriptions_as_tree() RETURNS TABLE(id integer, parent_id integer, title text, description text, interval_starts_on date, interval_ends_on date, created_at timestamp without time zone, updated_at timestamp without time zone, sort integer[])
    LANGUAGE sql
    AS $$

  WITH RECURSIVE tree AS
    ( SELECT
        subscriptions.id,
        subscriptions.parent_id,
        subscriptions.title,
        subscriptions.description,
        subscriptions.interval_starts_on,
        subscriptions.interval_ends_on,
        subscriptions.created_at,
        subscriptions.updated_at,
        array[subscriptions.id] as sort
      FROM subscriptions
      WHERE parent_id is null
    UNION ALL
      SELECT
        s.id,
        s.parent_id,
        s.title,
        s.description,
        s.interval_starts_on,
        s.interval_ends_on,
        s.created_at,
        s.updated_at,
        t.sort || s.id
      FROM tree t, subscriptions s
      WHERE s.parent_id = t.id )

SELECT * FROM tree t ORDER BY t.sort DESC
$$;


